import classes from "./Quiz.module.css";

function submitQuiz() {
  <div>{console.log("submit quiz")}</div>;
}
// on submit, show results
//submitButton.addEventListener("click", submitQuiz);
//test
export default function QuizPage() {
  //values for scales and displaying them
  const priceScale = 0;
  const sweetScale = 0;
  const yearScale = 0;
  
  //get event value
  const getInputValue = (bar, event) => {
    const userValue = event.target.value;
  };

  return (
    <div id="quiz">
      <li>
        <ul>What color would you like your wine?</ul>
        <ul>
          <input type="checkbox" id="redWine" />
          <label for="redWine"> Red</label>
          <br />
          <input type="checkbox" id="whiteWine" />
          <label for="whiteWine"> White</label>
        </ul>
        <ul>How expensive?</ul>
        <ul>
          <input
            type="range"
            id="priceScale"
            min="10"
            max="10000"
            onChange={getInputValue}
          />
          <output
            for="priceScale"
            onforminput="value = foo.valueAsNumber;"
          ></output>
        </ul>
        <ul>How sweet?</ul>
        <ul>
          <input
            type="range"
            id="sweetScale"
            min="1"
            max="100"
            onChange={getInputValue}
          />
        </ul>
        <ul>What Year?</ul>
        <ul>
          <input
            type="range"
            id="yearScale"
            min="1750"
            max="2022"
            onChange={getInputValue}
          />
        </ul>
        <ul>Region? (cuntry)</ul>
        <ul>
          <input type="text" id="regionInput" />
        </ul>
      </li>
      <button id="submit" onClick={submitQuiz()}>
        Submit
      </button>
      <p>
        Value: <span id="demo"></span>
      </p>
    </div>
  );
}
